function [fitresult, gof] = createFit(CdfX_G, CdfY_G)
%CREATEFIT(CDFX_G,CDFY_G)
%  Create a fit.
%
%  Data for 'untitled fit 1' fit:
%      X Input : CdfX_G
%      Y Output: CdfY_G
%  Output:
