%% Fit: 'untitled fit 1'.
[xData, yData] = prepareCurveData( CdfX_G, CdfY_G );

% Set up fittype and options.
ft = fittype( 'power1' );
opts = fitoptions( 'Method', 'NonlinearLeastSquares' );
opts.Display = 'Off';
opts.StartPoint = [0.353716802637917 -0.585114140025626];

% Fit model to data.
[fitresult, gof] = fit( xData, yData, ft, opts );

